<head><script src="https://cdn.jsdelivr.net/npm/@tensorflow/tfjs@0.13.5"> </script>
<script>
          async function loadModel(){ 
              model = await tf.loadModel('web_model/CanYouDrinkMe.json') 
              y = model.predict(tf.zeros([0, 0, 1, 2, 7, 0, 6, 1, 0, 3])) 
              document.getElementById('out').innerHTML = y.dataSync()[0] 
          } 
          loadModel() 
</script>
</head> 
<body>
        <p id ='out'></p>
        <p> WHY ARE U HERE? </p>
</body>
